pageDataArray[5] = [0,'Symbols Used in this Manual','symbolsusedinthismanual','Various symbols are used throughout this manual either to provide additional information on a specific topic or to warn of possible danger present during a procedure or an action. Be aware of all symbols when they are used, and always read NOTE, CAUTION, or WARNING messages. WARNING / 警告 Indicates an operating or maintenance procedure, practice or condition that, if not strictly observed, could result in injury or loss of life. Caution / 注意 Indicates an operating or maintenance procedure, practice or condition that, if not strictly observed, could result in personal injury or may cause damage to, or destruction of equipment. Check Point / チェックポイント Notes have important information and useful tips on the operation of your equipment. Adjustment / 調整 Indicates an operating or maintenance procedure, practice, or condition that is necessary to keep the product\'s quality. Assembly / 組み立て Indicates that a particular task must be carried out according to a certain standard after disassembly and before re-assembly, otherwise the quality of the components in question may be adversely affected. Lubrication / 注油 Indicates a lubrication point, practice, or condition that is necessary to keep the product\'s quality.','varioussymbolsareusedthroughoutthismanualeithertoprovideadditionalinformationonaspecifictopicortowarnofpossibledangerpresentduringaprocedureoranaction.beawareofallsymbolswhentheyareused,andalwaysreadnote,caution,orwarningmessages.warning/警告indicatesanoperatingormaintenanceprocedure,practiceorconditionthat,ifnotstrictlyobserved,couldresultininjuryorlossoflife.caution/注意indicatesanoperatingormaintenanceprocedure,practiceorconditionthat,ifnotstrictlyobserved,couldresultinpersonalinjuryormaycausedamageto,ordestructionofequipment.checkpoint/チェックポイントnoteshaveimportantinformationandusefultipsontheoperationofyourequipment.adjustment/調整indicatesanoperatingormaintenanceprocedure,practice,orconditionthatisnecessarytokeeptheproduct\'squality.assembly/組み立てindicatesthataparticulartaskmustbecarriedoutaccordingtoacertainstandardafterdisassemblyandbeforere-assembly,otherwisethequalityofthecomponentsinquestionmaybeadverselyaffected.lubrication/注油indicatesalubricationpoint,practice,orconditionthatisnecessarytokeeptheproduct\'squality.','44957872.html'];
