pageDataArray[7] = [0,'Product Overview','productoverview','L8050 Series ET-18100 Series/L18050 Series Product Features The features of this product are as follows: Main customer segments are online photo stores, photo studios, photo kiosks, copy stores, and tourist photos. High productivity Printing speed for photos is fast L8050 Series (Photo default 4x6") Current model: 27 sec / Competitor’s current model: 47 sec L8050 Series: 25 sec ET-18100 Series/L18050 Series (Photo default 4x6") Current model: 26 sec / Competitor’s current model: 45 sec ET-18100 Series/L18050 Series: 26 sec High durability More number of sheets can be printed than the current model. Current model: 16K L8050 Series: 50K Current model: 30K ET-18100 Series/L18050 Series: 50K Use of a maintenance box that can be replaced by customers reduces down time. Use of an LD Roller that can be replaced by customers reduces down time and improves durability. Compact, easy-to-access printer Reduced volume from its predecessors to save space. (Ink tank is integrated.) L8050 Series: The printer size is 30% smaller than the current model. ET-18100 Series/L18050 Series: The printer size is 40% smaller than the current model. All front access By opening the upper side, users can access various maintenance operation. No need to leave extra side space for maintenance purposes. Versatile media printing In addition to CD/DVD print, PVC/ID card print function is newly supported. This genuine PVC/ID card print function can provide better and guaranteed quality of printing, especially for photoshop customers who currently use 3rd party tray. High quality Printing Taking advantage of Light Cyan and Light Magenta inks, L8050 Series/ET-18100 Series/L18050 Series have better gradation and less graininess. Thus, they are suitable especially for portrait and scenery photos. ','l8050serieset-18100series/l18050seriesproductfeaturesthefeaturesofthisproductareasfollows:maincustomersegmentsareonlinephotostores,photostudios,photokiosks,copystores,andtouristphotos.highproductivityprintingspeedforphotosisfastl8050series(photodefault4x6")currentmodel:27sec/competitor’scurrentmodel:47secl8050series:25secet-18100series/l18050series(photodefault4x6")currentmodel:26sec/competitor’scurrentmodel:45secet-18100series/l18050series:26sechighdurabilitymorenumberofsheetscanbeprintedthanthecurrentmodel.currentmodel:16kl8050series:50kcurrentmodel:30ket-18100series/l18050series:50kuseofamaintenanceboxthatcanbereplacedbycustomersreducesdowntime.useofanldrollerthatcanbereplacedbycustomersreducesdowntimeandimprovesdurability.compact,easy-to-accessprinterreducedvolumefromitspredecessorstosavespace.(inktankisintegrated.)l8050series:theprintersizeis30%smallerthanthecurrentmodel.et-18100series/l18050series:theprintersizeis40%smallerthanthecurrentmodel.allfrontaccessbyopeningtheupperside,userscanaccessvariousmaintenanceoperation.noneedtoleaveextrasidespaceformaintenancepurposes.versatilemediaprintinginadditiontocd/dvdprint,pvc/idcardprintfunctionisnewlysupported.thisgenuinepvc/idcardprintfunctioncanprovidebetterandguaranteedqualityofprinting,especiallyforphotoshopcustomerswhocurrentlyuse3rdpartytray.highqualityprintingtakingadvantageoflightcyanandlightmagentainks,l8050series/et-18100series/l18050serieshavebettergradationandlessgraininess.thus,theyaresuitableespeciallyforportraitandsceneryphotos.','42860689.html'];
