pageDataArray[20] = [0,'Print Head','printhead','L8050 Series and ET-18100 Series/L18050 Series employ the F6H Print Head. Color Six colors (Dye ink): Photo black (Pk), Light cyan (LC), Magenta (M), Cyan (C), Yellow (Y), Light magenta (LM) Number of nozzles Total 1080 nozzles Photo black: 180 nozzles Light cyan: 180 nozzles Magenta: 180 nozzles Cyan: 180 nozzles Yellow: 180 nozzles Light magenta: 180 nozzles Nozzle pitch 180 dpi A: Cover Head B: Nozzle Plate Nozzle layout (seen from the rear side) 1: Cover Head 2: Standard pin position Column Color A Photo black B Light cyan C Magenta D Cyan E Yellow F Light magenta','l8050seriesandet-18100series/l18050seriesemploythef6hprinthead.colorsixcolors(dyeink):photoblack(pk),lightcyan(lc),magenta(m),cyan(c),yellow(y),lightmagenta(lm)numberofnozzlestotal1080nozzlesphotoblack:180nozzleslightcyan:180nozzlesmagenta:180nozzlescyan:180nozzlesyellow:180nozzleslightmagenta:180nozzlesnozzlepitch180dpia:coverheadb:nozzleplatenozzlelayout(seenfromtherearside)1:coverhead2:standardpinpositioncolumncoloraphotoblackblightcyancmagentadcyaneyellowflightmagenta','51708124.html'];
pageDataArray[21] = [0,'Carriage Mechanism','carriagemechanism','The major components of the carriage (CR) mechanism are the CR,Assy (F), Encoder,CR (G), Scale,CR (B), Motor CR (H), Belt,CR (D). The CR mechanism is a key mechanism to ensure stable print quality because printing is performed by moving the CR,Assy (F) from side to side. The CR,Assy (F) is placed and held on the Main Frame (A). The CR,Assy (F) is attached to the Belt,CR (D) that is moved by the Motor CR (H) so that the unit can move from side to side to print. The position and speed of the CR,Assy (F) are always monitored using the Encoder,CR (G) and Scale,CR (B), and the Motor CR (H) is controlled in accordance with the information acquired by the Encoder,CR (G).','themajorcomponentsofthecarriage(cr)mechanismarethecr,assy(f),encoder,cr(g),scale,cr(b),motorcr(h),belt,cr(d).thecrmechanismisakeymechanismtoensurestableprintqualitybecauseprintingisperformedbymovingthecr,assy(f)fromsidetoside.thecr,assy(f)isplacedandheldonthemainframe(a).thecr,assy(f)isattachedtothebelt,cr(d)thatismovedbythemotorcr(h)sothattheunitcanmovefromsidetosidetoprint.thepositionandspeedofthecr,assy(f)arealwaysmonitoredusingtheencoder,cr(g)andscale,cr(b),andthemotorcr(h)iscontrolledinaccordancewiththeinformationacquiredbytheencoder,cr(g).','51708399.html'];
pageDataArray[22] = [0,'APG Mechanism Operation','apgmechanismoperation','The improved type of the APG mechanism in XP-800 series is employed. APG Mechanism Configuration PG Type PG Shift Operation','theimprovedtypeoftheapgmechanisminxp-800seriesisemployed.apgmechanismconfigurationpgtypepgshiftoperation','51708446.html'];
pageDataArray[23] = [0,'APG Mechanism Configuration','apgmechanismconfiguration','The APG mechanism includes the Lever,APG (B) that controls APG, Rear Cam,APG (D), and Slider,APG Rear (E) that are attached on the carriage (C). Since the Main Frame (A) supports the carriage (C) in this product, the Rear Cam,APG (D) is attached at the rear side of the printer. The carriage (C) is on the Rear Cam,APG (D). When the Rear Cam,APG (D) slide, the carriage (C) on the cams also moves up and down, which enables the PG shift. By moving the carriage (C) toward the Lever,APG (B), Lever,APG (B) touches the Slider,APG Rear (E), and moves the Rear Cam,APG (D).','theapgmechanismincludesthelever,apg(b)thatcontrolsapg,rearcam,apg(d),andslider,apgrear(e)thatareattachedonthecarriage(c).sincethemainframe(a)supportsthecarriage(c)inthisproduct,therearcam,apg(d)isattachedattherearsideoftheprinter.thecarriage(c)isontherearcam,apg(d).whentherearcam,apg(d)slide,thecarriage(c)onthecamsalsomovesupanddown,whichenablesthepgshift.bymovingthecarriage(c)towardthelever,apg(b),lever,apg(b)touchestheslider,apgrear(e),andmovestherearcam,apg(d).','51708461.html'];
pageDataArray[24] = [0,'PG Type','pgtype','This product has five types of PGs. The following describes the details of PGs. The PG depends on the relative position of the carriage to the Lever,APG. The PG set once is held until the next PG shift operation. Check Point / チェックポイント Implement PG adjustments in the PG - state. Printer enters PG Typ. or PG - with a normal power off. (differs by paper setting)','thisproducthasfivetypesofpgs.thefollowingdescribesthedetailsofpgs.thepgdependsontherelativepositionofthecarriagetothelever,apg.thepgsetonceishelduntilthenextpgshiftoperation.checkpoint/チェックポイントimplementpgadjustmentsinthepg-state.printerenterspgtyp.orpg-withanormalpoweroff.(differsbypapersetting)','51708683.html'];
pageDataArray[25] = [0,'PG Shift Operation','pgshiftoperation','The PG shift operations are performed before paper loading*1 during the state (IS: OFF) in which the drive force of the Motor PF,Assy is not applied to the Ink System Mechanism. Before the PG shift operation, the APG reset is always performed (PG is set to “PG +3”).*2 The following shows the APG reset and PG shift operation. *1: Before paper loading, PG is shifted to the appropriate PG position corresponding to the paper specified by the printer driver. *2: This reset operation is performed only when PG is shifted wider. APG reset operation A: Movement of carriage B: Movement of Rear Cam,APG No. Detailed operation 1 The printer enters the state (ASF: OFF) in which the drive force of the Motor PF,Assy is not transmitted to the Ink System Mechanism. When the printer has entered the state, the carriage is at the 0-digit side. 2 The printer rotates the Motor PF,Assy CW to reset the Lever,APG. 3 The carriage moves to the APG reset standby position on the Full-digit side. 4 The printer rotates the Motor PF,Assy CCW to set the Lever,APG. 5 The carriage moves toward the Lever,APG. After the carriage reaches the APG reset complete position, the Lever,APG pushes the Slider,APG Rear and the Rear Cam,APG moves up along the stepped part of the Slider,APG Rear slider to set PG +3. 6 The carriage moves to the Full-digit side and stops at the APG reset standby position. 7 The printer rotates the Motor PF,Assy CW to reset the Lever,APG. Shift operation from PG +3 to target PG A: Movement of carriage B: Movement of Rear Cam,APG No. Detailed operation 1 The printer rotates the Motor PF,Assy CW to reset the Lever,APG. 2 The carriage moves to the 0-digit side and stops at the APG shift standby position. 3 The printer rotates the Motor PF,Assy CCW to set the Lever,APG. 4 The carriage moves toward the Lever,APG. After the carriage reaches the set position of the target PG, the Lever,APG pushes the Slider,APG Rear to set the target PG. 5 The carriage moves to the 0-digit side and stops at the APG shift standby position. 6 The printer rotates the Motor PF,Assy CW to reset the Lever,APG.','thepgshiftoperationsareperformedbeforepaperloading*1duringthestate(is:off)inwhichthedriveforceofthemotorpf,assyisnotappliedtotheinksystemmechanism.beforethepgshiftoperation,theapgresetisalwaysperformed(pgissetto“pg+3”).*2thefollowingshowstheapgresetandpgshiftoperation.*1:beforepaperloading,pgisshiftedtotheappropriatepgpositioncorrespondingtothepaperspecifiedbytheprinterdriver.*2:thisresetoperationisperformedonlywhenpgisshiftedwider.apgresetoperationa:movementofcarriageb:movementofrearcam,apgno.detailedoperation1theprinterentersthestate(asf:off)inwhichthedriveforceofthemotorpf,assyisnottransmittedtotheinksystemmechanism.whentheprinterhasenteredthestate,thecarriageisatthe0-digitside.2theprinterrotatesthemotorpf,assycwtoresetthelever,apg.3thecarriagemovestotheapgresetstandbypositiononthefull-digitside.4theprinterrotatesthemotorpf,assyccwtosetthelever,apg.5thecarriagemovestowardthelever,apg.afterthecarriagereachestheapgresetcompleteposition,thelever,apgpushestheslider,apgrearandtherearcam,apgmovesupalongthesteppedpartoftheslider,apgrearslidertosetpg+3.6thecarriagemovestothefull-digitsideandstopsattheapgresetstandbyposition.7theprinterrotatesthemotorpf,assycwtoresetthelever,apg.shiftoperationfrompg+3totargetpga:movementofcarriageb:movementofrearcam,apgno.detailedoperation1theprinterrotatesthemotorpf,assycwtoresetthelever,apg.2thecarriagemovestothe0-digitsideandstopsattheapgshiftstandbyposition.3theprinterrotatesthemotorpf,assyccwtosetthelever,apg.4thecarriagemovestowardthelever,apg.afterthecarriagereachesthesetpositionofthetargetpg,thelever,apgpushestheslider,apgreartosetthetargetpg.5thecarriagemovestothe0-digitsideandstopsattheapgshiftstandbyposition.6theprinterrotatesthemotorpf,assycwtoresetthelever,apg.','51709009.html'];
pageDataArray[26] = [0,'Paper Loading/Feeding Mechanism','paperloading/feedingmechanism','Overview Paper Feed Path Drive Path','overviewpaperfeedpathdrivepath','52889509.html'];
pageDataArray[27] = [0,'Overview','overview','Each mechanism related to Paper Feeding Mechanism are driven by the Motor PF,Assy which is controlled by the Detector,PF. However, Paper Loading Mechanism (Rear ASF) is driven by the Rear ASF Motor which is controlled by the Rear ASF Motor,Encoder. Mechanism Overview Rear paper loading Roller,LD,Assy (B) rotates in the paper loading direction when the Rear ASF Motor (D) rotates in the paper feeding direction. Paper set in the Hopper,Assy (A) is loaded in the printer by the Roller,LD,Assy (B). The Hopper,Assy (A) and the Paper Back Lever which prevents the multi-feed, are driven by the Cam moved by the Roller,LD,Assy (B). The state of the Roller,LD,Assy (B) is detected by the Detector,LD,Phase (C). Paper feeding Printing on Paper Paper is fed by driving the Roller,PF,Assy (H) and the EJ Roller,Assy (F) with the Motor PF,Assy (E). Printing on disk media Detect the CDR ID Tray inserted from the front side of the printer by user with the Detector,PW, and perform printing by transporting the tray with the Roller,PF,Assy (H) and the EJ Roller,Assy (F).','eachmechanismrelatedtopaperfeedingmechanismaredrivenbythemotorpf,assywhichiscontrolledbythedetector,pf.however,paperloadingmechanism(rearasf)isdrivenbytherearasfmotorwhichiscontrolledbytherearasfmotor,encoder.mechanismoverviewrearpaperloadingroller,ld,assy(b)rotatesinthepaperloadingdirectionwhentherearasfmotor(d)rotatesinthepaperfeedingdirection.papersetinthehopper,assy(a)isloadedintheprinterbytheroller,ld,assy(b).thehopper,assy(a)andthepaperbackleverwhichpreventsthemulti-feed,aredrivenbythecammovedbytheroller,ld,assy(b).thestateoftheroller,ld,assy(b)isdetectedbythedetector,ld,phase(c).paperfeedingprintingonpaperpaperisfedbydrivingtheroller,pf,assy(h)andtheejroller,assy(f)withthemotorpf,assy(e).printingondiskmediadetectthecdridtrayinsertedfromthefrontsideoftheprinterbyuserwiththedetector,pw,andperformprintingbytransportingthetraywiththeroller,pf,assy(h)andtheejroller,assy(f).','52889506.html'];
pageDataArray[28] = [0,'Paper Feed Path','paperfeedpath','Rear Paper Loading Paper put on the Hopper,Assy (B) is fed by the Roller,LD,Assy (A) and arrives at the Detector,PE (E) position. Then, after skew is corrected, printing on the paper is performed while the paper is being fed by the Roller,PF,Assy (C) and EJ Roller,Assy (D). Printing on disk media For the printing on disk media, the printer tells the user to set the CDR ID Tray (A). Then, after checking the CDR ID Tray (A) is set, the printer pulls the tray into the inside. If no problem is found after whether the medium is set or not is checked using the Detector,PW, the printer pulls the CDR ID Tray (A) into the rear side. After the CDR ID Tray (A) is set at the print start position, the tray is fed by the Roller,PF,Assy (B) and EJ Roller,Assy (C) while printed. After the printing is completed, the CDR ID Tray (A) is ejected from the front side of the printer.','rearpaperloadingpaperputonthehopper,assy(b)isfedbytheroller,ld,assy(a)andarrivesatthedetector,pe(e)position.then,afterskewiscorrected,printingonthepaperisperformedwhilethepaperisbeingfedbytheroller,pf,assy(c)andejroller,assy(d).printingondiskmediafortheprintingondiskmedia,theprintertellstheusertosetthecdridtray(a).then,aftercheckingthecdridtray(a)isset,theprinterpullsthetrayintotheinside.ifnoproblemisfoundafterwhetherthemediumissetornotischeckedusingthedetector,pw,theprinterpullsthecdridtray(a)intotherearside.afterthecdridtray(a)issetattheprintstartposition,thetrayisfedbytheroller,pf,assy(b)andejroller,assy(c)whileprinted.aftertheprintingiscompleted,thecdridtray(a)isejectedfromthefrontsideoftheprinter.','52889513.html'];
pageDataArray[29] = [0,'Drive Path','drivepath','The Motor PF,Assy drive force is transmitted to the Paper Feeding Mechanism (Roller,PF,Assy and the EJ Roller,Assy). The Rear ASF Motor drive force is transmitted to the Paper Loading Mechanism (Roller,LD,Assy, Hopper,Assy and Paper Back Lever). Drive path from Motor PF,Assy to Roller,PF,Assy/EJ Roller,Assy Motor PF,Assy (A) which is controlled by the Detector,PF (E) drives the Roller,PF,Assy (C) and the EJ Roller,Assy (D) via Belt,PF (B). Drive path from Rear ASF Motor to Roller,LD,Assy Rear ASF Motor (A) which is controlled by the Rear ASF Motor,Encoder drives Roller,LD,Assy (G), Hopper,Assy (J), and Paper Back Lever. The state of the Roller,LD,Assy (G) is detected by the Detecor,LD,Phase (K).','themotorpf,assydriveforceistransmittedtothepaperfeedingmechanism(roller,pf,assyandtheejroller,assy).therearasfmotordriveforceistransmittedtothepaperloadingmechanism(roller,ld,assy,hopper,assyandpaperbacklever).drivepathfrommotorpf,assytoroller,pf,assy/ejroller,assymotorpf,assy(a)whichiscontrolledbythedetector,pf(e)drivestheroller,pf,assy(c)andtheejroller,assy(d)viabelt,pf(b).drivepathfromrearasfmotortoroller,ld,assyrearasfmotor(a)whichiscontrolledbytherearasfmotor,encoderdrivesroller,ld,assy(g),hopper,assy(j),andpaperbacklever.thestateoftheroller,ld,assy(g)isdetectedbythedetecor,ld,phase(k).','52889524.html'];
pageDataArray[30] = [0,'Ink Supply Mechanism','inksupplymechanism','The Ink Supply Mechanism plays the role of supplying ink filled in the Ink Tank Assy (D) to the Print Head via the Tube,Adapter,S/L (C), Valve Assy (E), and Adapter Assy (A). The Valve Assy (E) is attached on the CR,Assy (B) to prevent ink leakage during shipment. Ink leakage is prevented during shipment by flipping the Cam Lever,Valve (F) on the Valve Assy (E) over to the front side of the printer, and setting the valve in a closed state by blocking the Tube,Adapter,S/L (C). This state of the valve is not controlled by sensors or the like. However, when the CR,Assy (B) is moved while the valve is in a closed state, the Cam Lever,Valve (F) and Housing will come into contact with each other, so if printing is implemented without setting the Cam Lever,Valve (F) to the valve open state after shipment, the CR,Assy (B) will not be able to move and an error will occur because the Cam Lever,Valve (F) will touch the Housing when the CR,Assy (B) is operated. By checking the position of the CR,Assy (B) at this time, it is possible to detect whether an error has occurred because the valve is closed. 1: Valve opened When the Cam Lever,Valve (F) is flipped to the back side of the printer, the Slider,Valve (G) releases the Tube,Adapter,S/L (C). 2: Valve closed When the Cam Lever,Valve (F) is flipped to the front side of the printer, the Slider,Valve (G) blocks the Tube,Adapter,S/L (C).','theinksupplymechanismplaystheroleofsupplyinginkfilledintheinktankassy(d)totheprintheadviathetube,adapter,s/l(c),valveassy(e),andadapterassy(a).thevalveassy(e)isattachedonthecr,assy(b)topreventinkleakageduringshipment.inkleakageispreventedduringshipmentbyflippingthecamlever,valve(f)onthevalveassy(e)overtothefrontsideoftheprinter,andsettingthevalveinaclosedstatebyblockingthetube,adapter,s/l(c).thisstateofthevalveisnotcontrolledbysensorsorthelike.however,whenthecr,assy(b)ismovedwhilethevalveisinaclosedstate,thecamlever,valve(f)andhousingwillcomeintocontactwitheachother,soifprintingisimplementedwithoutsettingthecamlever,valve(f)tothevalveopenstateaftershipment,thecr,assy(b)willnotbeabletomoveandanerrorwilloccurbecausethecamlever,valve(f)willtouchthehousingwhenthecr,assy(b)isoperated.bycheckingthepositionofthecr,assy(b)atthistime,itispossibletodetectwhetheranerrorhasoccurredbecausethevalveisclosed.1:valveopenedwhenthecamlever,valve(f)isflippedtothebacksideoftheprinter,theslider,valve(g)releasesthetube,adapter,s/l(c).2:valveclosedwhenthecamlever,valve(f)isflippedtothefrontsideoftheprinter,theslider,valve(g)blocksthetube,adapter,s/l(c).','52035601.html'];
pageDataArray[31] = [0,'Ink System Mechanism','inksystemmechanism','The major components of the ink system mechanism are a Cap, Pump Unit, and Waste Ink Tube. The Ink System Mechanism employs the direct acting type for capping. The Motor PF,Assy drives the Pump Mechanism, Capping Mechanism, Wiper Mechanism, Carriage Lock Mechanism, and Venting Valve Mechanism to clean the Print Head. The Maintenance Box can be replaced by users. The Maintenance Box is equipped with the CSIC, which saves/manages the waste ink amount. Overview Operating Principles','themajorcomponentsoftheinksystemmechanismareacap,pumpunit,andwasteinktube.theinksystemmechanismemploysthedirectactingtypeforcapping.themotorpf,assydrivesthepumpmechanism,cappingmechanism,wipermechanism,carriagelockmechanism,andventingvalvemechanismtocleantheprinthead.themaintenanceboxcanbereplacedbyusers.themaintenanceboxisequippedwiththecsic,whichsaves/managesthewasteinkamount.overviewoperatingprinciples','52035626.html'];
pageDataArray[32] = [0,'Overview','overview','Mechanical Configuration The Ink System Mechanism of this product employs the direct acting type*1 and consists of the Carriage Lock Mechanism (A), Wiper Mechanism (B), Capping Mechanism (E), and Pump Mechanism (D). All the mechanisms are driven by the Motor PF,Assy. The drive force of the Motor PF,Assy is transmitted to each mechanism via transmission parts, such as the pump-drive compound gear, clutch gear, and cam. Additionally, this product utilize a user-replaceable Maintenance Box (waste ink pad) (C) that retains waste ink from the cap. *1: There are two types of the capping: sliding type and direct acting type. In the sliding type, the Printhead (F) is capped (the cap is moved up) when the CR pushes the cap slider. In the direct acting type, the cap moves up and down independently of the CR and caps the Printhead (F). A Porous Pad B Venting Valve C Pump Unit D Pump-drive compound gear E Link Lever F Wiper G Cap H Carriage Lock Lever I Waste Ink Tube (to Waste Ink Tray) J Intermittent gear K Clutch gear L Wiper/Cap-drive Cam M Wiper Drive Lever N Wiper Holder Cleaning Clogging of nozzles on the Printhead occurs due to air bubbles generated inside the ink path of the Printhead, or an increase in ink viscosity caused by drying of ink. To prevent the clogging or clean the clogged nozzles, various types of cleaning (CL) are performed at different times as described in the table below. CL Type Purpose Explanation Initial ink charge To fill the head with ink Performed after the printer is powered at the first time. Timer cleaning (TCL)*1 To eject bigger air bubbles inside the Print Head Performed according to the printing time and time elapsed since the last cleaning. Manual cleaning (MCL)*2 CL1 To restore a proper convex meniscus of ink at the tip of nozzles Main suction*3 (short) → Wiping*4 → Cap suction*5 → Small amount suction*6 → Cap suction CL2 To eject air bubbles inside the Print Head Main suction (middle) → Wiping → Cap suction → Small amount suction → Cap suction CL3*7 To eject air bubbles inside the ink supply nozzles Main suction (long) → Wiping → Cap suction → Small amount suction → Cap suction Regular cap suction To prevent ink leakage from the cap Sucks out ink pooling inside the cap due to head flushing operations or the like. Flushing To prevent ink inside nonused nozzles from increasing its viscosity The Print Head is controlled to fire ink droplets from the nozzles periodically. *1: To save ink, the time between the timer cleanings is becoming longer on the most newer printers. This is achieved by adopting the plastic that have the function to suppress the growth of air bubbles inside the Print Head and by improving in shape of the ink supply nozzles. *2: When carrying out manual cleaning, CL1 → CL2 → CL3 are automatically selected and performed in order. However, in the following conditions, they may not be carried out in this order. (EX) : CL3 may change to CL2 depending on the ink remaining quantity and conditions of maintenance counter and others. If the interval between cleaning is more than a specified period, then this may not be counted as continuous. *3: “Main suction” is a suction operation that sucks up ink from cartridges to the Print Head, and at the same time, sucks out air bubbles inside the Print Head and thick ink inside the nozzles. *4: “Wiping” removes ink attached to the Print Head nozzle surface. *5: “Cap suction” is a suction operation that sucks ink out of the cap. *6: “Small amount suction” is a suction operation performed to eject tiny air bubbles from the Print Head. Ink amount sucked by this operation is less than that by the “Main suction”. *7: Some off-carriage type printers use a choke valve mechanism to perform the cleaning. Controlling Waste Ink Absorbed amount exceeds the limit of the waste ink pad, leakage of the waste ink can occur. To prevent this, the printer firmware has a counter to counts the waste ink amount taking evaporation into account, The count value is retained in the Maintenance Box CSIC and in the EEPROM. Another waste ink produced by borderless printing is absorbed by absorbers attached on the Paper Guide Front and the rear side of the printer. For the borderless printing, the printer makes an image slightly expand all the way to the edge of the paper, therefore, the image edge portions not printed on paper must be absorbed. the printer also have the counter for this waste ink amount. A Porouspad,PG Lower,Left B Maintenance Box C Porouspad,PG Lower,Right D Porous Pad,IS Lower,A/B If each counter reaches its limit, a maintenance error occurs and replacement of the maintenance box and counter reset will be required.','mechanicalconfigurationtheinksystemmechanismofthisproductemploysthedirectactingtype*1andconsistsofthecarriagelockmechanism(a),wipermechanism(b),cappingmechanism(e),andpumpmechanism(d).allthemechanismsaredrivenbythemotorpf,assy.thedriveforceofthemotorpf,assyistransmittedtoeachmechanismviatransmissionparts,suchasthepump-drivecompoundgear,clutchgear,andcam.additionally,thisproductutilizeauser-replaceablemaintenancebox(wasteinkpad)(c)thatretainswasteinkfromthecap.*1:therearetwotypesofthecapping:slidingtypeanddirectactingtype.intheslidingtype,theprinthead(f)iscapped(thecapismovedup)whenthecrpushesthecapslider.inthedirectactingtype,thecapmovesupanddownindependentlyofthecrandcapstheprinthead(f).aporouspadbventingvalvecpumpunitdpump-drivecompoundgearelinkleverfwipergcaphcarriagelockleveriwasteinktube(towasteinktray)jintermittentgearkclutchgearlwiper/cap-drivecammwiperdrivelevernwiperholdercleaningcloggingofnozzlesontheprintheadoccursduetoairbubblesgeneratedinsidetheinkpathoftheprinthead,oranincreaseininkviscositycausedbydryingofink.topreventthecloggingorcleanthecloggednozzles,varioustypesofcleaning(cl)areperformedatdifferenttimesasdescribedinthetablebelow.cltypepurposeexplanationinitialinkchargetofilltheheadwithinkperformedaftertheprinterispoweredatthefirsttime.timercleaning(tcl)*1toejectbiggerairbubblesinsidetheprintheadperformedaccordingtotheprintingtimeandtimeelapsedsincethelastcleaning.manualcleaning(mcl)*2cl1torestoreaproperconvexmeniscusofinkatthetipofnozzlesmainsuction*3(short)→wiping*4→capsuction*5→smallamountsuction*6→capsuctioncl2toejectairbubblesinsidetheprintheadmainsuction(middle)→wiping→capsuction→smallamountsuction→capsuctioncl3*7toejectairbubblesinsidetheinksupplynozzlesmainsuction(long)→wiping→capsuction→smallamountsuction→capsuctionregularcapsuctiontopreventinkleakagefromthecapsucksoutinkpoolinginsidethecapduetoheadflushingoperationsorthelike.flushingtopreventinkinsidenonusednozzlesfromincreasingitsviscositytheprintheadiscontrolledtofireinkdropletsfromthenozzlesperiodically.*1:tosaveink,thetimebetweenthetimercleaningsisbecominglongeronthemostnewerprinters.thisisachievedbyadoptingtheplasticthathavethefunctiontosuppressthegrowthofairbubblesinsidetheprintheadandbyimprovinginshapeoftheinksupplynozzles.*2:whencarryingoutmanualcleaning,cl1→cl2→cl3areautomaticallyselectedandperformedinorder.however,inthefollowingconditions,theymaynotbecarriedoutinthisorder.(ex):cl3maychangetocl2dependingontheinkremainingquantityandconditionsofmaintenancecounterandothers.iftheintervalbetweencleaningismorethanaspecifiedperiod,thenthismaynotbecountedascontinuous.*3:“mainsuction”isasuctionoperationthatsucksupinkfromcartridgestotheprinthead,andatthesametime,sucksoutairbubblesinsidetheprintheadandthickinkinsidethenozzles.*4:“wiping”removesinkattachedtotheprintheadnozzlesurface.*5:“capsuction”isasuctionoperationthatsucksinkoutofthecap.*6:“smallamountsuction”isasuctionoperationperformedtoejecttinyairbubblesfromtheprinthead.inkamountsuckedbythisoperationislessthanthatbythe“mainsuction”.*7:someoff-carriagetypeprintersuseachokevalvemechanismtoperformthecleaning.controllingwasteinkabsorbedamountexceedsthelimitofthewasteinkpad,leakageofthewasteinkcanoccur.topreventthis,theprinterfirmwarehasacountertocountsthewasteinkamounttakingevaporationintoaccount,thecountvalueisretainedinthemaintenanceboxcsicandintheeeprom.anotherwasteinkproducedbyborderlessprintingisabsorbedbyabsorbersattachedonthepaperguidefrontandtherearsideoftheprinter.fortheborderlessprinting,theprintermakesanimageslightlyexpandallthewaytotheedgeofthepaper,therefore,theimageedgeportionsnotprintedonpapermustbeabsorbed.theprinteralsohavethecounterforthiswasteinkamount.aporouspad,pglower,leftbmaintenanceboxcporouspad,pglower,rightdporouspad,islower,a/bifeachcounterreachesitslimit,amaintenanceerroroccursandreplacementofthemaintenanceboxandcounterresetwillberequired.','52035634.html'];
pageDataArray[33] = [0,'Operating Principles','operatingprinciples','Drive Path Operation of Each Mechanism','drivepathoperationofeachmechanism','56393969.html'];
pageDataArray[34] = [0,'Drive Path','drivepath','The Ink System Mechanism is driven by the Motor PF,Assy. The following describes the drive path. The drive force of the Motor PF,Assy is transmitted to the Ink System Mechanism only when the change lever is in the ink system drive position. At this time, the drive force of the Motor PF,Assy is transmitted to the Pump-drive Compound Gear via the Roller,PF,Assy, Guide Gear, and spur gear DE. The rotation of the Pump-drive Compound Gear drives the Pump Unit and is transmitted to the Wiper/Cap-drive Cam and intermittent gear via the clutch gear. The rotation of the Wiper/Cap-drive Cam moves up and down the Cap and Wiper, sets and releases the carriage lock, and opens and closes the Venting Valve via the Drive Levers for each mechanism. The following table lists the relationship between the operation of each mechanism and rotation direction of the Motor PF,Assy. Mechanism Rotation direction of PF Motor CW CCW Wiper Down Up (wiping position) Cap Down Up (capping) Pump Release Suction CR lock Down (carriage lock released) Up (carriage lock set) Venting Valve Open Closed The rotation of the Wiper/Cap-drive Cam moves up or down the drive levers for each mechanism. When the levers for each mechanism reach the upper end or lower end, the drive force of the Motor PF,Assy is cut by the clutch gear and intermittent gear. Then, when the rotation direction of the Motor PF,Assy is reversed, the clutch is on, the rotation direction of the Wiper/Cap-drive Cam is reversed, and the drive levers for each mechanism move inversely. This prevents mechanisms except the pump mechanism from driving while the Motor PF,Assy rotates continuously to drive the Pump Mechanism.','theinksystemmechanismisdrivenbythemotorpf,assy.thefollowingdescribesthedrivepath.thedriveforceofthemotorpf,assyistransmittedtotheinksystemmechanismonlywhenthechangeleverisintheinksystemdriveposition.atthistime,thedriveforceofthemotorpf,assyistransmittedtothepump-drivecompoundgearviatheroller,pf,assy,guidegear,andspurgearde.therotationofthepump-drivecompoundgeardrivesthepumpunitandistransmittedtothewiper/cap-drivecamandintermittentgearviatheclutchgear.therotationofthewiper/cap-drivecammovesupanddownthecapandwiper,setsandreleasesthecarriagelock,andopensandclosestheventingvalveviathedriveleversforeachmechanism.thefollowingtableliststherelationshipbetweentheoperationofeachmechanismandrotationdirectionofthemotorpf,assy.mechanismrotationdirectionofpfmotorcwccwwiperdownup(wipingposition)capdownup(capping)pumpreleasesuctioncrlockdown(carriagelockreleased)up(carriagelockset)ventingvalveopenclosedtherotationofthewiper/cap-drivecammovesupordownthedriveleversforeachmechanism.whentheleversforeachmechanismreachtheupperendorlowerend,thedriveforceofthemotorpf,assyiscutbytheclutchgearandintermittentgear.then,whentherotationdirectionofthemotorpf,assyisreversed,theclutchison,therotationdirectionofthewiper/cap-drivecamisreversed,andthedriveleversforeachmechanismmoveinversely.thispreventsmechanismsexceptthepumpmechanismfromdrivingwhilethemotorpf,assyrotatescontinuouslytodrivethepumpmechanism.','52035653.html'];
pageDataArray[35] = [0,'Operation of Each Mechanism','operationofeachmechanism','Pump Mechanism The Pump Mechanism sucks ink from the Printhead at cleaning. The drive force from the pump-drive compound gear is transmitted to the pump shaft via the timing plate. This timing plate allows the pump-drive compound gear to start rotating at the different timing from the pump shaft. After the Motor PF,Assy rotates for a while, the pump unit starts its operation. When the Motor PF,Assy rotates CCW as seen from the output-shaft side of the motor, the drive force via the pump-drive compound gear rotates the pump pulley to flatten the tube to suck the air (to generate negative pressure) inside the tube. When the Motor PF,Assy rotates CW, the pump pulley does not flatten the tube, and the negative pressure is released. Motor PF,Assy CCW rotation (suction) Motor PF,Assy CW rotation (release) Rotates flattening the tube. Rotates without flattening the tube. Pump Unit structure A Pump frame B Pump tube C Pump pulley D Pump cam E Pump shaft F Pump plate G Timing plate H Pump-drive compound gear Capping Mechanism The direct acting type is employed in the Capping Mechanism, where the cap is moved up and down by the Motor PF,Assy and the Print Head is capped at the suction for cleaning. The Motor PF,Assy rotates the Wiper/Cap-drive Cam to move up and down the cap drive lever to cap the Print Head. Cap down Cap up A Printhead --- B Cap --- C Cap drive lever --- D Wiper/Cap-drive cam The cam face of the wiper/cap-drive cam (yellow part) moves up and down the cap drive lever. Carriage Lock Mechanism The tension of the compression spring at the bottom of the carriage lock moves up the carriage lock. When the carriage lock drive lever pushes the carriage lock downward, the carriage lock is released. Since the carriage lock drive lever moves up and down together with the cap drive lever, the carriage lock also operates together with the movement of the cap. This means that the Print Head nozzle surface is always capped when the carriage lock is set. Lever down Lever up A Print Head B Carriage lock C Compression spring D Cap drive lever E Wiper/Cap-drive cam F Carriage lock drive lever Wiper Mechanism and Venting Valve The rotation of the wiper/cap-drive cam drives the wiper mechanism. The rotation of the wiper/cap-drive cam moves the salient of the wiper drive lever along the cam groove of the wiper/cap-drive cam to move the wiper holder up and down. When the wiper is up, the wiper drive lever releases the link lever and the venting valve is closed by the tension of the compression spring. When the wiper is down, the wiper drive lever pushes the link lever to open the venting valve. Wiper down / Valve open (vented) Wiper up / Valve closed A Tube (connected to cap) --- B Wiper --- C Wiper holder --- D Link lever --- E Compression spring --- F Wiper drive lever --- G Wiper/Cap-drive cam The rotation of the wiper/cap drive cam moves the salient of the wiper drive lever along the cam groove of the wiper/cap-drive cam (yellow part) to move the wiper holder up and down.','pumpmechanismthepumpmechanismsucksinkfromtheprintheadatcleaning.thedriveforcefromthepump-drivecompoundgearistransmittedtothepumpshaftviathetimingplate.thistimingplateallowsthepump-drivecompoundgeartostartrotatingatthedifferenttimingfromthepumpshaft.afterthemotorpf,assyrotatesforawhile,thepumpunitstartsitsoperation.whenthemotorpf,assyrotatesccwasseenfromtheoutput-shaftsideofthemotor,thedriveforceviathepump-drivecompoundgearrotatesthepumppulleytoflattenthetubetosucktheair(togeneratenegativepressure)insidethetube.whenthemotorpf,assyrotatescw,thepumppulleydoesnotflattenthetube,andthenegativepressureisreleased.motorpf,assyccwrotation(suction)motorpf,assycwrotation(release)rotatesflatteningthetube.rotateswithoutflatteningthetube.pumpunitstructureapumpframebpumptubecpumppulleydpumpcamepumpshaftfpumpplategtimingplatehpump-drivecompoundgearcappingmechanismthedirectactingtypeisemployedinthecappingmechanism,wherethecapismovedupanddownbythemotorpf,assyandtheprintheadiscappedatthesuctionforcleaning.themotorpf,assyrotatesthewiper/cap-drivecamtomoveupanddownthecapdrivelevertocaptheprinthead.capdowncapupaprinthead---bcap---ccapdrivelever---dwiper/cap-drivecamthecamfaceofthewiper/cap-drivecam(yellowpart)movesupanddownthecapdrivelever.carriagelockmechanismthetensionofthecompressionspringatthebottomofthecarriagelockmovesupthecarriagelock.whenthecarriagelockdriveleverpushesthecarriagelockdownward,thecarriagelockisreleased.sincethecarriagelockdrivelevermovesupanddowntogetherwiththecapdrivelever,thecarriagelockalsooperatestogetherwiththemovementofthecap.thismeansthattheprintheadnozzlesurfaceisalwayscappedwhenthecarriagelockisset.leverdownleverupaprintheadbcarriagelockccompressionspringdcapdriveleverewiper/cap-drivecamfcarriagelockdriveleverwipermechanismandventingvalvetherotationofthewiper/cap-drivecamdrivesthewipermechanism.therotationofthewiper/cap-drivecammovesthesalientofthewiperdriveleveralongthecamgrooveofthewiper/cap-drivecamtomovethewiperholderupanddown.whenthewiperisup,thewiperdriveleverreleasesthelinkleverandtheventingvalveisclosedbythetensionofthecompressionspring.whenthewiperisdown,thewiperdriveleverpushesthelinklevertoopentheventingvalve.wiperdown/valveopen(vented)wiperup/valveclosedatube(connectedtocap)---bwiper---cwiperholder---dlinklever---ecompressionspring---fwiperdrivelever---gwiper/cap-drivecamtherotationofthewiper/capdrivecammovesthesalientofthewiperdriveleveralongthecamgrooveofthewiper/cap-drivecam(yellowpart)tomovethewiperholderupanddown.','56393983.html'];
