pageDataArray[47] = [0,'Overview','overview','This section explains the basic procedure for troubleshooting problems on the printer quickly and efficiently. When carrying out the troubleshooting procedures, take a flexible measure following your sales company\'s policy and considering the trouble situation. Preliminary Check Make sure to check the following items before servicing the printer. Is foreign object inside the printer preventing a normal operation? Is outside or inside of the printer not contaminated badly? Any missing, damaged, or deformed units or parts in printer components? There is no damage on the cables and they are connected correctly to the specified connector (connected straight and in the correct direction)? Cams/gears in the printer mechanism has no uneven wear or are not badly worn, and are assembled correctly?','thissectionexplainsthebasicprocedurefortroubleshootingproblemsontheprinterquicklyandefficiently.whencarryingoutthetroubleshootingprocedures,takeaflexiblemeasurefollowingyoursalescompany\'spolicyandconsideringthetroublesituation.preliminarycheckmakesuretocheckthefollowingitemsbeforeservicingtheprinter.isforeignobjectinsidetheprinterpreventinganormaloperation?isoutsideorinsideoftheprinternotcontaminatedbadly?anymissing,damaged,ordeformedunitsorpartsinprintercomponents?thereisnodamageonthecablesandtheyareconnectedcorrectlytothespecifiedconnector(connectedstraightandinthecorrectdirection)?cams/gearsintheprintermechanismhasnounevenwearorarenotbadlyworn,andareassembledcorrectly?','45285930.html'];
pageDataArray[48] = [0,'Troubleshooting Operation Flow','troubleshootingoperationflow','The following page describes the troubleshooting workflow. Follow the flow when troubleshooting problems. Check Point / チェックポイント This flowchart is compiled based on the following contents. Our experience regarding the quality problem. ESK’s repair data. Printer Mechanism specification for the product. If the reason for the return is evident, first check the phenomenon user claims recurs, then proceed to the troubleshooting. Workflow when the Power is ON Workflow for Errors when Printing Starts','thefollowingpagedescribesthetroubleshootingworkflow.followtheflowwhentroubleshootingproblems.checkpoint/チェックポイントthisflowchartiscompiledbasedonthefollowingcontents.ourexperienceregardingthequalityproblem.esk’srepairdata.printermechanismspecificationfortheproduct.ifthereasonforthereturnisevident,firstcheckthephenomenonuserclaimsrecurs,thenproceedtothetroubleshooting.workflowwhenthepowerisonworkflowforerrorswhenprintingstarts','48434634.html'];
