pageDataArray[52] = [0,'Troubleshooting from Error Code','troubleshootingfromerrorcode','This section describes how to check the error code, description, and the possible causes. Displaying the Fatal Error Code The fatal error code is stored in the EEPROM on the Main Board and can be read out using the Adjustment Program. When a fatal error occurs in this product, the LEDs on the panel flash. See Error Indicators on the Printer for details. Normal Errors Fatal Errors','thissectiondescribeshowtochecktheerrorcode,description,andthepossiblecauses.displayingthefatalerrorcodethefatalerrorcodeisstoredintheeepromonthemainboardandcanbereadoutusingtheadjustmentprogram.whenafatalerroroccursinthisproduct,theledsonthepanelflash.seeerrorindicatorsontheprinterfordetails.normalerrorsfatalerrors','48434638.html'];
