pageDataArray[56] = [0,'Other Errors','othererrors','Error code Error name Error details Error solution 990200 Security (user restriction) Print restriction Occurs if user authentication was successful but there is no PC printing privilege for that user. Add the PC printing privilege for the corresponding user in WebConfig and NetConfig. 990201 Security (user restriction) Authentication error Occurs if user authentication failed. Occurs if the setting for permitting execution of a job with no authentication information is set to “Prohibit” when a print job with no authentication information (user name and password) is received. Check that the user name and password are correct. Set the setting for permitting execution of a job with no authentication information to “Permit”. 990600 PS version mismatch error --- Occurs when the versions of the PS module and printer board do not match Version update 991000 Restart notification warning accompany changes to settings --- Occurs when the settings of setting items that require a restart have been changed. PC connection via USB Restart.','errorcodeerrornameerrordetailserrorsolution990200security(userrestriction)printrestrictionoccursifuserauthenticationwassuccessfulbutthereisnopcprintingprivilegeforthatuser.addthepcprintingprivilegeforthecorrespondinguserinwebconfigandnetconfig.990201security(userrestriction)authenticationerroroccursifuserauthenticationfailed.occursifthesettingforpermittingexecutionofajobwithnoauthenticationinformationissetto“prohibit”whenaprintjobwithnoauthenticationinformation(usernameandpassword)isreceived.checkthattheusernameandpasswordarecorrect.setthesettingforpermittingexecutionofajobwithnoauthenticationinformationto“permit”.990600psversionmismatcherror---occurswhentheversionsofthepsmoduleandprinterboarddonotmatchversionupdate991000restartnotificationwarningaccompanychangestosettings---occurswhenthesettingsofsettingitemsthatrequirearestarthavebeenchanged.pcconnectionviausbrestart.','52330613.html'];
