pageDataArray[64] = [0,'System Error','systemerror','Error code Error name Possible cause Confirmation procedure Connector No. 202620 Wi-Fi Board failure Failure or disconnection of the wireless network board Check the Board,Wi-Fi. Check the cable. Main Board CN3 203004 Panel Unit Failure Failure or disconnection of the Panel Assy Replace the Panel,Assy with a new one. Check the FFC. Main Board CN20 2xxxxx Firmware bug An error code will be assigned to each firmware internal error as necessary. Check the firmware version, and update it. Replace the Main Board with a new one. --- 3xxxxx Check Point / チェックポイント Since the listed errors are common for all EPSON printers, some of the errors do not occur in this product.','errorcodeerrornamepossiblecauseconfirmationprocedureconnectorno.202620wi-fiboardfailurefailureordisconnectionofthewirelessnetworkboardchecktheboard,wi-fi.checkthecable.mainboardcn3203004panelunitfailurefailureordisconnectionofthepanelassyreplacethepanel,assywithanewone.checktheffc.mainboardcn202xxxxxfirmwarebuganerrorcodewillbeassignedtoeachfirmwareinternalerrorasnecessary.checkthefirmwareversion,andupdateit.replacethemainboardwithanewone.---3xxxxxcheckpoint/チェックポイントsincethelistederrorsarecommonforallepsonprinters,someoftheerrorsdonotoccurinthisproduct.','52330641.html'];
