pageDataArray[88] = [0,'Factors which Affect the Print Quality','factorswhichaffecttheprintquality','Wetting of Ventilation Film The film under sealing film attached on the Ink Tank Assy is breathable film (A). The air in the Ink Tank Assy is released to outside through this film and then the air hole (B) to keep ink supply to the Print Head stable. If the film gets wet with ink, the air in the tank is not properly released outside and may cause degradation in print quality. Determining whether the breathable film is wet or not Assembly / 組み立て When the breathable film is wet, Ink Tank Assy replacement is necessary. Because it is hard to notice that the film is wet just by visually checking its surface, determine that according to whether the ink has reached to a certain portion of the air chamber (A). When the ink has reached the red squared part of the air chamber (A) shown below, replace the Ink Tank Assy.','wettingofventilationfilmthefilmundersealingfilmattachedontheinktankassyisbreathablefilm(a).theairintheinktankassyisreleasedtooutsidethroughthisfilmandthentheairhole(b)tokeepinksupplytotheprintheadstable.ifthefilmgetswetwithink,theairinthetankisnotproperlyreleasedoutsideandmaycausedegradationinprintquality.determiningwhetherthebreathablefilmiswetornotassembly/組み立てwhenthebreathablefilmiswet,inktankassyreplacementisnecessary.becauseitishardtonoticethatthefilmiswetjustbyvisuallycheckingitssurface,determinethataccordingtowhethertheinkhasreachedtoacertainportionoftheairchamber(a).whentheinkhasreachedtheredsquaredpartoftheairchamber(a)shownbelow,replacetheinktankassy.','52889658.html'];
