pageDataArray[148] = [0,'Around the Main Board','aroundthemainboard','When connecting the FFCs and the cables to the connectors on the Main Board, refer to the figure below. No. Connector No. Connection Description 1 CN3 Board,Wi-Fi --- 2 CN6 Panel,Assy After connecting to the connector (CN6), secure it with double-sided tape (J) as shown above. 3 CN8 Detector,PE After connecting to the connector (CN8), secure it with double-sided tape (G) as shown above. 4 CN13 Detector,PF --- 5 CN14 Rear ASF Motor,Encoder After connecting to the connector (CN14), secure it with double-sided tape (H) as shown above. 6 CN30 Motor CR Route the cable through the hook (F) and the hook (A), and then connect it to the connector (CN30). 7 CN31 Motor PF,Assy Set the ferrite core into the position (B) shown above, and then route the cable through the hook (C) and the hook (D), and connect it to the connector (CN31). 8 CN36 Rear ASF Motor Set the ferrite core into the position (E) shown above, and then route the cable through the three slits () and the hook (A), and then connect it to the connector (CN36). 9 CN40 Print Head --- 10 CN41 Print Head --- 11 CN42 Print Head --- 12 CN43 Print Head --- 13 CN50 Encoder,CR --- 14 CN54 Detector,Stacker Open Turn the cable around the hook (I) twice, and then connect it to the connector (CN54). 15 CN59 Detector,LD,Phase Route the cable through the hook (F) and the hook (A), and then connect it to the connector (CN59). 16 CN60 Connector,CSIC --- 17 CN501 PS Unit Route the cable through the hook (F) and the hook (A), and then connect it to the connector (CN501). Connector layout','whenconnectingtheffcsandthecablestotheconnectorsonthemainboard,refertothefigurebelow.no.connectorno.connectiondescription1cn3board,wi-fi---2cn6panel,assyafterconnectingtotheconnector(cn6),secureitwithdouble-sidedtape(j)asshownabove.3cn8detector,peafterconnectingtotheconnector(cn8),secureitwithdouble-sidedtape(g)asshownabove.4cn13detector,pf---5cn14rearasfmotor,encoderafterconnectingtotheconnector(cn14),secureitwithdouble-sidedtape(h)asshownabove.6cn30motorcrroutethecablethroughthehook(f)andthehook(a),andthenconnectittotheconnector(cn30).7cn31motorpf,assysettheferritecoreintotheposition(b)shownabove,andthenroutethecablethroughthehook(c)andthehook(d),andconnectittotheconnector(cn31).8cn36rearasfmotorsettheferritecoreintotheposition(e)shownabove,andthenroutethecablethroughthethreeslits()andthehook(a),andthenconnectittotheconnector(cn36).9cn40printhead---10cn41printhead---11cn42printhead---12cn43printhead---13cn50encoder,cr---14cn54detector,stackeropenturnthecablearoundthehook(i)twice,andthenconnectittotheconnector(cn54).15cn59detector,ld,phaseroutethecablethroughthehook(f)andthehook(a),andthenconnectittotheconnector(cn59).16cn60connector,csic---17cn501psunitroutethecablethroughthehook(f)andthehook(a),andthenconnectittotheconnector(cn501).connectorlayout','54034641.html'];
pageDataArray[149] = [0,'FFC,Head,Assy/Encoder,CR FFC (L8050 Series)','ffc,head,assy/encoder,crffc(l8050series)','Secure the FFC,Encoder,CR and the FFC,Head,Assy (A) with double-sided tape (x2) (B). Pull out the FFC,Head, Assy. and the FFC,Encoder,CR (A) from the hole on the CR,Assy (C), and then route them in the procedure given below. Hook the FFCs (A) on the rib on the CR,Assy, and then route them through the hooks (x3) and slits (x3) on the Frame,Front,Assy (E). Fold the FFCs (A) along the fold lines, and route them through the ferrite core (D), and then set the ferrite (D) core into the position shown below. Secure the FFCs (A) with acetate tape (F) to the Frame,Front,Assy (E).','securetheffc,encoder,crandtheffc,head,assy(a)withdouble-sidedtape(x2)(b).pullouttheffc,head,assy.andtheffc,encoder,cr(a)fromtheholeonthecr,assy(c),andthenroutethemintheproceduregivenbelow.hooktheffcs(a)ontheribonthecr,assy,andthenroutethemthroughthehooks(x3)andslits(x3)ontheframe,front,assy(e).foldtheffcs(a)alongthefoldlines,androutethemthroughtheferritecore(d),andthensettheferrite(d)coreintothepositionshownbelow.securetheffcs(a)withacetatetape(f)totheframe,front,assy(e).','55576524.html'];
pageDataArray[150] = [0,'FFC,Head,Assy/FFC,Encoder,CR (ET-18100 Series/L18050 Series)','ffc,head,assy/ffc,encoder,cr(et-18100series/l18050series)','Secure the FFC,Encoder,CR and the FFC,Head,Assy (A) with double-sided tape (x2) (B). Pull out the FFC,Head,Assy and the FFC,Encoder,CR (A) from the hole on the CR,Assy (C), and then route them in the procedure given below. Hook the FFCs (A) on the rib on the CR,Assy, and then route them through the hooks (x3) and slits (x4) on the Frame,Front,Assy (E). Fold the FFCs (A) along the fold lines, and route them through the ferrite core (D), and then set the ferrite (D) core into the position shown below. Secure the FFCs (A) with acetate tape (F) to the Frame,Front,Assy (E).','securetheffc,encoder,crandtheffc,head,assy(a)withdouble-sidedtape(x2)(b).pullouttheffc,head,assyandtheffc,encoder,cr(a)fromtheholeonthecr,assy(c),andthenroutethemintheproceduregivenbelow.hooktheffcs(a)ontheribonthecr,assy,andthenroutethemthroughthehooks(x3)andslits(x4)ontheframe,front,assy(e).foldtheffcs(a)alongthefoldlines,androutethemthroughtheferritecore(d),andthensettheferrite(d)coreintothepositionshownbelow.securetheffcs(a)withacetatetape(f)totheframe,front,assy(e).','60560987.html'];
