pageDataArray[175] = [0,'PG Adjustment','pgadjustment','This section describes the procedure for checking the platen gap (PG). PG Adjustment Bush The PG Adjustment Bush, which you need to operate to adjust the PG, is located on both sides of the CR,Assy. Resolution of PG Adjustment Bush: 0.1 mm/level Adjustment range of PG Adjustment Bush: +/- 0.5mm (5 levels) PG Adjustment Bush Left (Full-digit side) PG Adjustment Bush Right (0-digit side) Check Point / チェックポイント The standard range of the PG is as follows: Standard 0-digit side：1.3 +/- 0.1 mm Full-digit side：1.3 +/- 0.2 mm The number of adjustment levels for the PG Adjustment Bush on the Full-digit side shall be within ±1 level of the number of adjustment levels of the PG Adjustment Bush on the 0-digit side. Check the platen gap before installing the Scale,CR. Preparation Confirmation Procedure Adjustment Procedure','thissectiondescribestheprocedureforcheckingtheplatengap(pg).pgadjustmentbushthepgadjustmentbush,whichyouneedtooperatetoadjustthepg,islocatedonbothsidesofthecr,assy.resolutionofpgadjustmentbush:0.1mm/leveladjustmentrangeofpgadjustmentbush:+/-0.5mm(5levels)pgadjustmentbushleft(full-digitside)pgadjustmentbushright(0-digitside)checkpoint/チェックポイントthestandardrangeofthepgisasfollows:standard0-digitside：1.3+/-0.1mmfull-digitside：1.3+/-0.2mmthenumberofadjustmentlevelsforthepgadjustmentbushonthefull-digitsideshallbewithin±1levelofthenumberofadjustmentlevelsofthepgadjustmentbushonthe0-digitside.checktheplatengapbeforeinstallingthescale,cr.preparationconfirmationprocedureadjustmentprocedure','52330729.html'];
pageDataArray[176] = [0,'Preparation','preparation','Tools Thickness gauges for PG check: 1.1 mm gauge, 1.2 mm gauge, 1.4 mm gauge, 1.5 mm gauge Set the PG position Before starting PG check, confirm that the PG position is PG-. If the PG position is not PG-, set the PG position to PG- by the following procedure. Procedure to set in the PG position (PG-) Rotate the Roller,PF,Assy (A) in the direction of the arrow and release the CR Lock. Move the CR,Assy to the center of the printer. Move the Belt,PF (A) in the direction of the arrow and set the Lever,APG (B). Lever,APG OK position Lever,APG NG position Move the CR,Assy (A) to the Full-digit side and the Lever,APG pushes the Slider,APG Rear and the Rear Cam,APG moves along the stepped part of the Slider,APG Rear to set PG-. Position of the Thickness gauge to check the PG Place the Thickness Gauge at the following two positions. 0-digit side: Position A Full-digit side: Position B','toolsthicknessgaugesforpgcheck:1.1mmgauge,1.2mmgauge,1.4mmgauge,1.5mmgaugesetthepgpositionbeforestartingpgcheck,confirmthatthepgpositionispg-.ifthepgpositionisnotpg-,setthepgpositiontopg-bythefollowingprocedure.proceduretosetinthepgposition(pg-)rotatetheroller,pf,assy(a)inthedirectionofthearrowandreleasethecrlock.movethecr,assytothecenteroftheprinter.movethebelt,pf(a)inthedirectionofthearrowandsetthelever,apg(b).lever,apgokpositionlever,apgngpositionmovethecr,assy(a)tothefull-digitsideandthelever,apgpushestheslider,apgrearandtherearcam,apgmovesalongthesteppedpartoftheslider,apgreartosetpg-.positionofthethicknessgaugetocheckthepgplacethethicknessgaugeatthefollowingtwopositions.0-digitside:positionafull-digitside:positionb','59703465.html'];
pageDataArray[177] = [0,'Confirmation Procedure','confirmationprocedure','Caution / 注意 When performing the PG check, make sure of the following. Move the CR,Assy by pulling the top of the Belt,CR. Be careful not to damage the nozzle surface of the Printhead with the thickness gauge. The number of adjustment levels for the PG Adjustment Bush on the Full-digit side shall be within ±1 level of the number of adjustment levels of the PG Adjustment Bush on the 0-digit side. 0-digit Side Confirmation Procedure Move the CR,Assy to the center of the printer. Place the thickness gauge (1.2 mm) on the position A. Move the CR,Assy to the 0-digit side and check if the CR,Assy does not touch the thickness gauge. If it touches the gauge, the PG is narrower than the standard. In such case, go to "Adjustment Procedure". If it does not touch the gauge, go to "Step 4". Move the CR,Assy to the center of the printer. Place the thickness gauge (1.4 mm) on the position A. Move the CR,Assy to the 0-digit side and check if the CR,Assy touches the thickness gauge. If it does not touch the gauge, the PG is wider than the standard. In such case, go to "Adjustment Procedure". If it touches the gauge, go to "Full-digit side confirmation procedure". Full-digit Side Confirmation Procedure Move the CR,Assy to the center of the printer. Place the thickness gauge (1.1 mm) on the position B. Move the CR,Assy to the Full-digit side and check if the CR,Assy does not touch the thickness gauge. If it touches the gauge, the PG is narrower than the standard. In such case, go to "Adjustment Procedure". If it does not touch the gauge, go to "Step 4". Move the CR,Assy to the center of the printer. Place the thickness gauge (1.5 mm) on the position B. Move the CR,Assy to the Full-digit side and check if the CR,Assy touches the thickness gauge. If it does not touch the gauge, the PG is wider than the standard. In such case, go to "Adjustment Procedure". If it touches the gauge, finish the PG Check/Adjustment.','caution/注意whenperformingthepgcheck,makesureofthefollowing.movethecr,assybypullingthetopofthebelt,cr.becarefulnottodamagethenozzlesurfaceoftheprintheadwiththethicknessgauge.thenumberofadjustmentlevelsforthepgadjustmentbushonthefull-digitsideshallbewithin±1levelofthenumberofadjustmentlevelsofthepgadjustmentbushonthe0-digitside.0-digitsideconfirmationproceduremovethecr,assytothecenteroftheprinter.placethethicknessgauge(1.2mm)onthepositiona.movethecr,assytothe0-digitsideandcheckifthecr,assydoesnottouchthethicknessgauge.ifittouchesthegauge,thepgisnarrowerthanthestandard.insuchcase,goto"adjustmentprocedure".ifitdoesnottouchthegauge,goto"step4".movethecr,assytothecenteroftheprinter.placethethicknessgauge(1.4mm)onthepositiona.movethecr,assytothe0-digitsideandcheckifthecr,assytouchesthethicknessgauge.ifitdoesnottouchthegauge,thepgiswiderthanthestandard.insuchcase,goto"adjustmentprocedure".ifittouchesthegauge,goto"full-digitsideconfirmationprocedure".full-digitsideconfirmationproceduremovethecr,assytothecenteroftheprinter.placethethicknessgauge(1.1mm)onthepositionb.movethecr,assytothefull-digitsideandcheckifthecr,assydoesnottouchthethicknessgauge.ifittouchesthegauge,thepgisnarrowerthanthestandard.insuchcase,goto"adjustmentprocedure".ifitdoesnottouchthegauge,goto"step4".movethecr,assytothecenteroftheprinter.placethethicknessgauge(1.5mm)onthepositionb.movethecr,assytothefull-digitsideandcheckifthecr,assytouchesthethicknessgauge.ifitdoesnottouchthegauge,thepgiswiderthanthestandard.insuchcase,goto"adjustmentprocedure".ifittouchesthegauge,finishthepgcheck/adjustment.','59703505.html'];
pageDataArray[178] = [0,'Adjustment Procedure','adjustmentprocedure','If the PG is Narrower than the Standard Loosen the screws on the PG Adjustment Bush Right (0-digit side) and Left (Full-digit side). Down the PG Adjustment Bush Right (A) (0-digit side) and Left (B) (Full-digit side) by one notch. Tighten the screw on the PG Adjustment Bush Right (0-digit side) and Left (Full-digit side). Go back to "Confirmation Procedure". If the PG is Wider than the Standard Loosen the screws on the PG Adjustment Bush Right (0-digit side) and Left (Full-digit side). Up the PG Adjustment Bush Right (A) (0-digit side) and Left (B) (Full-digit side) by one notch. Tighten the screw on the PG Adjustment Bush Right (0-digit side) and Left (Full-digit side). Go back to "Confirmation Procedure".','ifthepgisnarrowerthanthestandardloosenthescrewsonthepgadjustmentbushright(0-digitside)andleft(full-digitside).downthepgadjustmentbushright(a)(0-digitside)andleft(b)(full-digitside)byonenotch.tightenthescrewonthepgadjustmentbushright(0-digitside)andleft(full-digitside).gobackto"confirmationprocedure".ifthepgiswiderthanthestandardloosenthescrewsonthepgadjustmentbushright(0-digitside)andleft(full-digitside).upthepgadjustmentbushright(a)(0-digitside)andleft(b)(full-digitside)byonenotch.tightenthescrewonthepgadjustmentbushright(0-digitside)andleft(full-digitside).gobackto"confirmationprocedure".','59703507.html'];
