pageDataArray[180] = [0,'Adjustment','adjustment','EEPROM Data Copy Initial setting Head ID input Initialize PF deterioration offset Initialize PW sensor deterioration counter Initialize CDR-ID tray deterioration offset Photo sensor light level adjustment PF motor heat protection control CR motor heat protection control RASF motor heat protection control PTS delay adjustment Head angular adjustment Bi-d adjustment PW/1st Dot position adjustment PF/EJ adjustment PF band adjustment PE adjustment','eepromdatacopyinitialsettingheadidinputinitializepfdeteriorationoffsetinitializepwsensordeteriorationcounterinitializecdr-idtraydeteriorationoffsetphotosensorlightleveladjustmentpfmotorheatprotectioncontrolcrmotorheatprotectioncontrolrasfmotorheatprotectioncontrolptsdelayadjustmentheadangularadjustmentbi-dadjustmentpw/1stdotpositionadjustmentpf/ejadjustmentpfbandadjustmentpeadjustment','52330733.html'];
pageDataArray[181] = [0,'EEPROM Data Copy','eepromdatacopy','EEPROM Data stored in the EEPROM on the Main Board are read/stored and written onto the EEPROM of a new Main Board by using this menu. Use this function only when the Main Board has been replaced. Procedure EEPROM Data Backup Turn on the printer (Normal mode). Start the Adjustment program. Select the EEPROM Data Copy. Select item that dose backup (Put a check). Click the [Backup] button to backup selected data from current main board. Turn off the printer and replace current main board with new one. Check Point / チェックポイント If the EEPROM Data cannot be backed up, “Initial Setting” must be performed after replacing the Main Board. Refer to “Initial setting”. EEPROM Data Restore Check Point / チェックポイント After replacing the Main Board, write the firmware before performing software adjustments. On L8050 Series/ET-18100 Series/L18050 Series, when the printer is started up after the Main Board is replaced, the printer starts up in recovery mode. As the Adjustment Program cannot be connected to the printer in recovery mode, the firmware must be written. Turn on the printer (Printer Inspection mode). Start the Adjustment program. Select the EEPROM Data Copy. Select item(Put a check) that dose restore. Click the [Restore] button to save selected data on new main board. Turn off the printer. Turn on the printer (Normal mode) and continue the adjustment. Check Point / チェックポイント If the EEPROM Data cannot be restored, “Initial Setting” must be performed after replacing the Main Board. Refer to “Initial setting”.','eepromdatastoredintheeepromonthemainboardareread/storedandwrittenontotheeepromofanewmainboardbyusingthismenu.usethisfunctiononlywhenthemainboardhasbeenreplaced.procedureeepromdatabackupturnontheprinter(normalmode).starttheadjustmentprogram.selecttheeepromdatacopy.selectitemthatdosebackup(putacheck).clickthe[backup]buttontobackupselecteddatafromcurrentmainboard.turnofftheprinterandreplacecurrentmainboardwithnewone.checkpoint/チェックポイントiftheeepromdatacannotbebackedup,“initialsetting”mustbeperformedafterreplacingthemainboard.referto“initialsetting”.eepromdatarestorecheckpoint/チェックポイントafterreplacingthemainboard,writethefirmwarebeforeperformingsoftwareadjustments.onl8050series/et-18100series/l18050series,whentheprinterisstartedupafterthemainboardisreplaced,theprinterstartsupinrecoverymode.astheadjustmentprogramcannotbeconnectedtotheprinterinrecoverymode,thefirmwaremustbewritten.turnontheprinter(printerinspectionmode).starttheadjustmentprogram.selecttheeepromdatacopy.selectitem(putacheck)thatdoserestore.clickthe[restore]buttontosaveselecteddataonnewmainboard.turnofftheprinter.turnontheprinter(normalmode)andcontinuetheadjustment.checkpoint/チェックポイントiftheeepromdatacannotberestored,“initialsetting”mustbeperformedafterreplacingthemainboard.referto“initialsetting”.','52330737.html'];
