pageDataArray[183] = [0,'Initial setting (when there is no Default Password)','initialsetting(whenthereisnodefaultpassword)','Write model-specific initial settings to EEPROM Data in the main board by using this menu. Use this function only when the EEPROM Data cannot be backed up or restored when replacing the Main Board. Procedure Turn on the printer (Printer Inspection mode). Start the Adjustment program. Select the Initial Setting. Select item that does initialization. Enter the serial number. Click the [Perform] button. Click the [Check] button and check the setting information of the printer. Check Point / チェックポイント When the Main Board has been replaced, select the three check boxes below and click the [Perform] button. EEPROM initialize (except adjustment value): Writing the initial setting values excluding the adjustment value to EEPROM Adjustment value initialize: Writing adjustment value (initial value) to EEPROM Product Serial No.: Writing Product Serial No. to EEPROM To execute “EEPROM initialize (except adjustment value)”, the serial number must be entered.','writemodel-specificinitialsettingstoeepromdatainthemainboardbyusingthismenu.usethisfunctiononlywhentheeepromdatacannotbebackeduporrestoredwhenreplacingthemainboard.procedureturnontheprinter(printerinspectionmode).starttheadjustmentprogram.selecttheinitialsetting.selectitemthatdoesinitialization.entertheserialnumber.clickthe[perform]button.clickthe[check]buttonandcheckthesettinginformationoftheprinter.checkpoint/チェックポイントwhenthemainboardhasbeenreplaced,selectthethreecheckboxesbelowandclickthe[perform]button.eeprominitialize(exceptadjustmentvalue):writingtheinitialsettingvaluesexcludingtheadjustmentvaluetoeepromadjustmentvalueinitialize:writingadjustmentvalue(initialvalue)toeepromproductserialno.:writingproductserialno.toeepromtoexecute“eeprominitialize(exceptadjustmentvalue)”,theserialnumbermustbeentered.','59375641.html'];
