pageDataArray[189] = [0,'Photo sensor light level adjustment','photosensorlightleveladjustment','To adjust the current values supplied to the sensor to optimize the light amount of the Detector,PE/Detector,PW by using this menu. Use this function only when the EEPROM Data cannot be backed up or restored when replacing the Main Board if the Detector,PW or the Detector,PE has been replaced. Procedure Turn on the printer (Normal mode). Start the Adjustment program. Select the Photo sensor light level adjustment. Select PW sensor (Detector,PW) or PE sensor (Detector,PE). Set A4 size plain paper in the ASF. Click the [Perform] button to load the paper and adjust the light level of specified photo sensor.','toadjustthecurrentvaluessuppliedtothesensortooptimizethelightamountofthedetector,pe/detector,pwbyusingthismenu.usethisfunctiononlywhentheeepromdatacannotbebackeduporrestoredwhenreplacingthemainboardifthedetector,pworthedetector,pehasbeenreplaced.procedureturnontheprinter(normalmode).starttheadjustmentprogram.selectthephotosensorlightleveladjustment.selectpwsensor(detector,pw)orpesensor(detector,pe).seta4sizeplainpaperintheasf.clickthe[perform]buttontoloadthepaperandadjustthelightlevelofspecifiedphotosensor.','52330762.html'];
