pageDataArray[210] = [0,'Storage','storage','When you need to store the printer, follow the steps below to pack the printer. Turn off the printer by pressing the power button. Make sure the power light turns off, and then unplug the power cord. Disconnect all cables such as the power cord and USB cable. Remove all of the paper from the printer. Open the printer cover. Set the transportation lock to the locked (Transport) position. The transportation lock stops ink supply to prevent ink leakage when transporting and storing. If the print head is not in the position shown below, move it by hand. Secure the print head to the case with tape. Make sure to install the cap onto the ink tank securely. Close the ink tank cover securely. Close the printer cover. Prepare to pack the printer as shown below. Place the printer in the plastic bag supplied for transporting and fold it closed. Pack the printer in its box using the protective materials. Caution / 注意 When storing an ink bottle, do not tilt the bottle and do not subject it to impacts or temperature changes. Otherwise, ink may leak even if the cap on the ink bottle is tightened securely. Be sure to keep the ink bottle upright when tightening the cap, and take precautions to prevent ink from leaking when transporting the bottle, for example, putting the bottle in a bag. Do not put opened ink bottles in the box with printer.','whenyouneedtostoretheprinter,followthestepsbelowtopacktheprinter.turnofftheprinterbypressingthepowerbutton.makesurethepowerlightturnsoff,andthenunplugthepowercord.disconnectallcablessuchasthepowercordandusbcable.removeallofthepaperfromtheprinter.opentheprintercover.setthetransportationlocktothelocked(transport)position.thetransportationlockstopsinksupplytopreventinkleakagewhentransportingandstoring.iftheprintheadisnotinthepositionshownbelow,moveitbyhand.securetheprintheadtothecasewithtape.makesuretoinstallthecapontotheinktanksecurely.closetheinktankcoversecurely.closetheprintercover.preparetopacktheprinterasshownbelow.placetheprinterintheplasticbagsuppliedfortransportingandfolditclosed.packtheprinterinitsboxusingtheprotectivematerials.caution/注意whenstoringaninkbottle,donottiltthebottleanddonotsubjectittoimpactsortemperaturechanges.otherwise,inkmayleakevenifthecapontheinkbottleistightenedsecurely.besuretokeeptheinkbottleuprightwhentighteningthecap,andtakeprecautionstopreventinkfromleakingwhentransportingthebottle,forexample,puttingthebottleinabag.donotputopenedinkbottlesintheboxwithprinter.','48434693.html'];
pageDataArray[211] = [0,'Move & Transport','move&transport','When you need to transport it when moving or for repairs, see Storage to pack the printer. Caution / 注意 When carrying the printer, lift it using a stable position. Lifting the printer using an unstable position may result in injury. When lifting the printer, place your hands in the positions shown below. Do not hold printer at the front and back. When transporting an ink bottle, do not tilt the bottle and do not subject it to impacts or temperature changes. Otherwise, ink may leak even if the cap on the ink bottle is tightened securely. Be sure to keep the ink bottle upright when tightening the cap, and take precautions to prevent ink from leaking when transporting the bottle, for example, putting the bottle in a bag. Do not put opened ink bottles in the box with printer.','whenyouneedtotransportitwhenmovingorforrepairs,seestoragetopacktheprinter.caution/注意whencarryingtheprinter,liftitusingastableposition.liftingtheprinterusinganunstablepositionmayresultininjury.whenliftingtheprinter,placeyourhandsinthepositionsshownbelow.donotholdprinteratthefrontandback.whentransportinganinkbottle,donottiltthebottleanddonotsubjectittoimpactsortemperaturechanges.otherwise,inkmayleakevenifthecapontheinkbottleistightenedsecurely.besuretokeeptheinkbottleuprightwhentighteningthecap,andtakeprecautionstopreventinkfromleakingwhentransportingthebottle,forexample,puttingthebottleinabag.donotputopenedinkbottlesintheboxwithprinter.','48434695.html'];
