pageDataArray[216] = [0,'Cleaning the Paper Path for Paper Feeding Problems','cleaningthepaperpathforpaperfeedingproblems','When paper is not fed correctly, clean the roller inside. Press the power button to turn off the printer. Unplug the power cord. Open the printer cover. You can find the pickup roller (A) as the illustration below. Remove the pickup roller (A). Push the tab on the right side of the pickup roller (A), and then slide it backward and pull it out upward. Dampen a soft cloth with water, wring it out thoroughly, and then wipe the rubber part (A) of the roller in one direction. Caution / 注意 Do not touch the rubber part on the pickup roller. Attach the pickup roller. Push the tab, and then align the protrusions with the holes to attach. Close the printer cover. Connect the power cord. Press the power button to turn on the printer. Even if the problem is not solved, replace the pickup roller.','whenpaperisnotfedcorrectly,cleantherollerinside.pressthepowerbuttontoturnofftheprinter.unplugthepowercord.opentheprintercover.youcanfindthepickuproller(a)astheillustrationbelow.removethepickuproller(a).pushthetabontherightsideofthepickuproller(a),andthenslideitbackwardandpullitoutupward.dampenasoftclothwithwater,wringitoutthoroughly,andthenwipetherubberpart(a)oftherollerinonedirection.caution/注意donottouchtherubberpartonthepickuproller.attachthepickuproller.pushthetab,andthenaligntheprotrusionswiththeholestoattach.closetheprintercover.connectthepowercord.pressthepowerbuttontoturnontheprinter.eveniftheproblemisnotsolved,replacethepickuproller.','50331760.html'];
