pageDataArray[221] = [0,'Cleaning the Exterior Parts/inside of the printer','cleaningtheexteriorparts/insideoftheprinter','This section describes how to clean the sections other than the printhead. Instructions for cleaning Exterior parts such as housing Wipe dirt off with a soft clean cloth moistened with water. For glossy or transparent parts, use of unwoven cloth is recommended to avoid scratching those parts. Inside of the printer Remove paper dust with a vacuum cleaner. Rubber or plastic rollers used to feed paper If paper dust or the like adhered to the rollers decreases the frictional force of the rollers and causes paper feed problems, moisten a cloth with water or diluted alcohol and wring the water out, then wipe the dust off the roller using the cloth. Instructions for cleaning ink stains Wipe the stains off with a cloth wrung out of diluted alcohol. Caution / 注意 Do not use alcohol for cleaning the transparent parts. Doing so may cause them to get cloudy. When wiping off paper dust, be careful not to rub against the surface asperity. To minimize the effect on the parts, use diluted alcohol such as 70% diluted ether. After using alcohol for cleaning, make sure to wipe the part off with a soft dry dust-free cloth to remove alcohol traces fully.','thissectiondescribeshowtocleanthesectionsotherthantheprinthead.instructionsforcleaningexteriorpartssuchashousingwipedirtoffwithasoftcleanclothmoistenedwithwater.forglossyortransparentparts,useofunwovenclothisrecommendedtoavoidscratchingthoseparts.insideoftheprinterremovepaperdustwithavacuumcleaner.rubberorplasticrollersusedtofeedpaperifpaperdustorthelikeadheredtotherollersdecreasesthefrictionalforceoftherollersandcausespaperfeedproblems,moistenaclothwithwaterordilutedalcoholandwringthewaterout,thenwipethedustofftherollerusingthecloth.instructionsforcleaninginkstainswipethestainsoffwithaclothwrungoutofdilutedalcohol.caution/注意donotusealcoholforcleaningthetransparentparts.doingsomaycausethemtogetcloudy.whenwipingoffpaperdust,becarefulnottorubagainstthesurfaceasperity.tominimizetheeffectontheparts,usedilutedalcoholsuchas70%dilutedether.afterusingalcoholforcleaning,makesuretowipethepartoffwithasoftdrydust-freeclothtoremovealcoholtracesfully.','50888788.html'];
